PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "payroll_payslip" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created_at" datetime NULL, "is_active" bool NOT NULL, "group_name" varchar(50) NULL, "reference" varchar(255) NULL, "start_date" date NOT NULL, "end_date" date NOT NULL, "pay_head_data" text NOT NULL CHECK ((JSON_VALID("pay_head_data") OR "pay_head_data" IS NULL)), "contract_wage" real NULL, "basic_pay" real NULL, "gross_pay" real NULL, "deduction" real NULL, "net_pay" real NULL, "status" varchar(20) NULL, "sent_to_employee" bool NULL, "created_by_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "employee_id_id" bigint NOT NULL REFERENCES "employee_employee" ("id") DEFERRABLE INITIALLY DEFERRED, "modified_by_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "house_allowance" real NULL, "other_allowance" real NULL, "transport_allowance" real NULL);
COMMIT;
